// components/Admin/ManageServices.jsx
import React, { useState } from 'react';
import styles from './ManageServices.module.css';

const ManageServices = () => {
  const [services, setServices] = useState([
    { id: 1, name: 'Cleaning' },
    { id: 2, name: 'Electricity' }
  ]);
  const [newService, setNewService] = useState('');

  const addService = () => {
    if (newService.trim()) {
      setServices([...services, { id: services.length + 1, name: newService }]);
      setNewService('');
    }
  };

  return (
    <div className={styles.container}>
      <h2>Manage Services</h2>
      <input type="text" placeholder="New Service Name" value={newService} onChange={(e) => setNewService(e.target.value)} />
      <button onClick={addService}>Add Service</button>
      <ul>
        {services.map(service => (
          <li key={service.id}>{service.name}</li>
        ))}
      </ul>
    </div>
  );
};

export default ManageServices;
